const handleButtonOnClick = (
  className, history, setIsPersonalInformationVisible, onEnter, onLogin, onDelete,
) => {
  if (className === 'historyOrdersColumn') { history.push('./orders-history'); }
  if (className === 'basketColumn') { history.push('./basket'); }
  if (className === 'personalDataColumn') { setIsPersonalInformationVisible(true); }
  if (className === 'exitButton') { history.push('./main-page'); onEnter(true, false); onLogin(false, false, false); onDelete(); }
};

export default handleButtonOnClick;
